package sort;

public class Sort2Insert {

    public static void main(String[] args) {

        long startTime = System.currentTimeMillis();

        try {
            mainProcess();
        } catch (Exception | AssertionError e) {
            System.err.println("============== Error");
            e.printStackTrace();
            System.err.println("====================");
        } finally {
            System.out.println(
                    String.format("================== 종료 시간 : %d (ms)", System.currentTimeMillis() - startTime)
            );
        }
    }

    /**
     * i7 6 Core
     * Process time : 233ms ~ 300ms
     */
    private static void mainProcess() {

        String s = """
                
                """;

        assert !s.isEmpty();

        System.out.println(sort(s.toCharArray()));
    }


    private static String sort(String str) {
        return insertionSortProcess(str.toCharArray());
    }
    private static String sort(char[] chars) {
        return insertionSortProcess(chars);
    }


    /**
     * 삽입 정렬 처리
     * Best Time complexity : O(n^2), 역으로 정렬되어있는 경우
     * Worst Time complexity : O(n), 정렬되어있는 경우
     * Space complexity : O(n)
     * @param chars 문자 배열
     * @return 정렬 결과
     */
    private static String insertionSortProcess(char[] chars) {

        for (int i = 1; i < chars.length; i++) {

            // 작은값 발견시 순서를 땅김
            
            for (int j = i; j > 0; j--) {
                if (chars[j] < chars[j-1]) {
                    swap(chars, j, j-1);
                }
                else {
                    break;
                }
            }
        }

        return new String(chars);
    }

    /**
     * 문자 배열 Swap
     * @param chars 문자 배열
     * @param i i
     * @param j j
     */
    private static void swap(char[] chars, int i, int j) {
        char c = chars[i];
        chars[i] = chars[j];
        chars[j] = c;
    }

}
